import Track from "./Track";

function Playlist() {
  return (
    <div className="Playlist">
      <h1>Playlist</h1>
      <div className="Tracklist">
        {Track("wish i loved you in the 90s", "Tate Mcrae", "Too Young to Be Sad")}
      </div>
    </div>
  );
}

export default Playlist;
